<script type="text/javascript">
    $(function(){
    var ajax = null;
    var search_params = {};
    var totalResults = 0;
    var showedResults = 0;
    var start = 0;
    var length = 50;
    var mainStart = false;
    var mainLength = 1000;
    var totalRecords = [];
    var stopAjax = false;
    var prevPage = 1;
    var prevLen = 1;
    var typingTimer;                //timer identifier
    var doneTypingInterval = 500;

    function downloadRequest(search_params, user_id) {
        let url = 'https://sinzer.in/api/search/download-request';
        $.post(url,search_params,function(response){
            $("#snackbar").text(response['message']);
            showSnackBar();
        }).fail(function(){
            
        }).always(function(){
            
        });
    }
    function getMoreResults(page = 1) {
        if(stopAjax){
            return;
        }
        if(mainStart === false){
            mainStart = 0;
        } else {
            mainStart += mainLength;
        }
        search_params = {}
        let apikeyUrl = 'https://sinzer.in/api/user/get-api-key';
        $('.loader1').removeClass('hidden');
        if(mainStart>0){
            $('.loader2').removeClass('hidden');
        }
        $.post(apikeyUrl,{},function(response){
            let keys = response['data'];
            for(key in keys){
                search_params[key]= keys[key];
            }
            let postData = $('#search-form').serializeArray();
            params = postData
            var port = $('#nport').val();
            let getdata = false;
            for (var i = 0; i < postData.length; i++) {
                if (postData[i].value) {
                    search_params[postData[i]['name']] = postData[i]['value'];
                    getdata = true;
                }
            }
            if(getdata == false){
                return;
            }
            let url = 'https://sinzer.in:4513/search/customer';
            search_params['start'] = mainStart;
            let pagelen = parseInt($('.page-length').val());
            if(isNaN(pagelen)){
                pagelen = length;
            }
            search_params['length'] = mainLength;
            if(ajax != null)
                ajax.abort()
            ajax = $.post(url,search_params,function(response){
                response = JSON.parse(response);
                let results = response['data'];
                totalRecords = totalRecords.concat(results);
                showCustomers(page, true);
                if(results.length < mainLength){
                    stopAjax = true;
                }
            }).fail(function(){
                alert('Failed to get data please retry once again');
            }).always(function(){
                $('.loader1').removeClass('hidden').addClass('hidden');
                $('.loader2').removeClass('hidden').addClass('hidden');
            });
        }).fail(function(e, f){
            $('.loader1').removeClass('hidden').addClass('hidden');
            $('.loader2').removeClass('hidden').addClass('hidden');
            if(e.responseJSON.includes('No permissions')){
                location.reload()
            }
        }).always(function(){
            
        });
        
    }
    function showCustomers(page = 1, frommore=false) {
        let resHtml = '';
        let pagelen = parseInt($('.page-length').val());
        if(isNaN(pagelen)){
            $('.page-length').val(length);
            pagelen = length;
        }
        let sIndex = (page-1)*pagelen;
        let eIndex = sIndex + pagelen;
        let fromIndex = false;
        let rows = totalRecords.slice(sIndex, eIndex);
        if(rows.length == 0){
            $('.pagenum').val(prevPage);
            $('.page-length').val(prevLen);
            return;
        }
        $('.inprogress').removeClass('hidden')
        $('#search-results').html('');
        let sCount = 0;
        let filtered = false;
        let tSIndex = false;
        for(let index in totalRecords){
            let obj = totalRecords[index];
            let searchText = Object.values(obj).join(' ').toLowerCase();
            let searchVal = $('.searchbox').val().toLowerCase();
            if($('.searchbox').val()){
                if(searchText.includes(searchVal) != true){
                    filtered = true;
                    continue;
                }
            }
            sCount++;
            if(sCount <= sIndex){
                continue;
            }
            if(fromIndex === false){
                fromIndex = sCount;
            }
            let x = ''
            if(obj.district == undefined || obj.district == '') {
                let temp = $.trim($('#template').html());
                x = temp.replace(/{{name}}/ig, (obj.name == null ? '' : obj.name));
                x = x.replace(/{{father_name}}/ig, (obj.father_name == null ? '' : obj.father_name));
                x = x.replace(/{{phone_1}}/ig, (obj.phone_1 == null ? '' : obj.phone_1));
                x = x.replace(/{{phone_2}}/ig, (obj.phone_2 == null ? '' : obj.phone_2));
                x = x.replace(/{{address_1}}/ig, (obj.address_1 == null ? '' : obj.address_1));
                x = x.replace(/{{address_2}}/ig, (obj.address_2 == null ? '' : obj.address_2));
                x = x.replace(/{{email_1}}/ig, (obj.email_1 == null ? '' : obj.email_1));
                x = x.replace(/{{pan}}/ig, (obj.pan == null ? '' : obj.pan));
                x = x.replace(/{{dob}}/ig, (obj.dob == null ? '' : obj.dob));
                x = x.replace(/{{doa}}/ig, (obj.doa == null ? '' : obj.doa));
                x = x.replace(/{{adhar}}/ig, (obj.adhar == null ? '' : obj.adhar));
                x = x.replace(/{{gender}}/ig, (obj.gender == null ? '' : obj.gender));
                x = x.replace(/{{operator}}/ig, (obj.operator == null ? '' : obj.operator));
                x = x.replace(/{{pin_code}}/ig, (obj.pin_code == null ? '' : obj.pin_code));
                x = x.replace(/{{state}}/ig, (obj.state == null ? '' : obj.state));
            }else {
                let temp = $.trim($('#template_2').html());
                x = temp.replace(/{{name}}/ig, (obj.name == null ? '' : obj.name));
                x = x.replace(/{{father_name}}/ig, (obj.father_name == null ? '' : obj.father_name));
                x = x.replace(/{{phone_1}}/ig, (obj.phone_1 == null ? '' : obj.phone_1));
                x = x.replace(/{{address_1}}/ig, (obj.address_1 == null ? '' : obj.address_1));
                x = x.replace(/{{nominee_name}}/ig, (obj.nominee_name == null ? '' : obj.nominee_name));
                x = x.replace(/{{nominee_relation}}/ig, (obj.nominee_relation == null ? '' : obj.nominee_relation));
                x = x.replace(/{{dob}}/ig, (obj.dob == null ? '' : obj.dob));
            }
            resHtml += x;
            if(sCount>=sIndex+pagelen){
                break;
            }
        };
        $('#search-results').append(resHtml);
        let resCountMessage = 'Showing from '+(fromIndex)+' To '+(sCount);
        if(filtered){
            resCountMessage += ' Filetered rows '+(fromIndex === false ? 0 : sCount-fromIndex+1);
        }
        $(".results_count").text(resCountMessage)
        $('.pagination').removeClass('hidden')
        prevPage = page
        prevLen = $('.page-length').val();
        $('.pagenum').val(page)
        $('.inprogress').removeClass('hidden').addClass('hidden')
    }
    function doWeNeedToLoadData(page = 1) {
        if(stopAjax){
            return false;
        }
        let pagelen = parseInt($('.page-length').val());
        let sIndex = (page-1)*pagelen;
        let eIndex = sIndex + pagelen;
        let rows = totalRecords.slice(sIndex, eIndex);
        if (rows.length < pagelen){
            getMoreResults(page)
            return true;
        }else {
            return false;
        }
    }
    function clearResults(){
        $('#search-results').html('');
        showedResults = 0;
        $(".results_count").text('')
        mainStart = false;
        totalRecords = [];
        $('.searchbox').val();
    }

    function setAreas(areas){
        setDistricts(Object.keys(areas), areas, false)
    }

    function setDistricts(districts, areas, setmandal=true){
        let districtNames = JSON.parse($('#districts').val());
        let options = '<option value="">Select District</option>';
        for (var i = 0; i < districts.length; i++) {
            options += '<option value="'+districts[i]+'">'+districtNames[districts[i]]+'</option>';
        }
        $('[name="district_id"]').html(options);
        setMandals(Object.keys(areas[districts[0]]), districts, areas);
    }

    function setMandals(mandals, districts, areas){
        if(!$('[name="district_id"]').val()){
            return
        }
        let mandalNames = JSON.parse($('#mandals').val());
        let options = '<option value="">Select Mandal</option>';
        for (var i = 0; i < mandals.length; i++) {
            options += '<option value="'+mandals[i]+'">'+mandalNames[mandals[i]]+'</option>';
        }
        $('[name="mandal_id"]').html(options);
        setVillages(areas[districts[0]][mandals[0]], mandals, districts, areas)
    }

    function setVillages(villages, mandals, districts, areas){
        if(!$('[name="mandal_id"]').val()){
            return
        }
        let villageNames = JSON.parse($('#villages').val());
        let options = '<option value="">Select Village</option>';
        for (var i = 0; i < villages.length; i++) {
            options += '<option value="'+villages[i]+'">'+villageNames[villages[i]]+'</option>';
        }
        $('[name="village_id"]').html(options);
    }

    $(document).ready(function() {
        $('#search-btn').on('click', function () {
            stopAjax = false;
            clearResults();
            getMoreResults();
        });
        $('#download-btn').on('click', function () {
            let postData = $('#search-form').serializeArray();
            params = postData
            var user_id = $('#user_id').val();
            for (var i = 0; i < postData.length; i++) {
                if (postData[i].value) {
                    search_params[postData[i]['name']] = postData[i]['value'];
                }
            }
            search_params['user_id'] = user_id;
            downloadRequest(search_params);
        });
        $('.page-length').on('change', function() {
            $('.page-length').val($(this).val());
            $('.pagenum').val(1);
            showCustomers($('.pagenum').val());
        })
        $('.pagenum').on('input', function() {
            $('.pagenum').val($(this).val());
        })
        $('.goto').on('click', function () {
            let page = parseInt($('.pagenum').val());
            if(doWeNeedToLoadData(page) == false){
                showCustomers(page);
            }
        });
        $('.next').on('click', function () {
            let page = parseInt($('.pagenum').val())+1;
            if(doWeNeedToLoadData(page) == false){
                showCustomers(page);
            }
        });
        $('.prev').on('click', function () {
            let page = parseInt($('.pagenum').val())-1;
            if(doWeNeedToLoadData(page) == false){
                showCustomers(page);
            }
        });
        $('#clear').on('click', function () {
            if(ajax != null)
                ajax.abort()
            clearResults();
        });
        $('.searchbox').on('input', function() {
            $('.searchbox').val($(this).val());
            clearTimeout(typingTimer);
            typingTimer = setTimeout(showCustomers, doneTypingInterval);
        })
        var areas = JSON.parse($('#areas').val());
        setAreas(areas)

        $('[name="datatype"]').on('click', function () {
            if($(this).val() == 'access_database'){
                $('.allfields').removeClass('hidden').addClass('hidden')
                $('.allfields input').val('')
                $('.insurance').removeClass('hidden')
            }else if($(this).val() == 'roap'){
                $('.allfields').removeClass('hidden').addClass('hidden')
                $('.allfields input').val('')
                $('.roap').removeClass('hidden')
            }else{
                $('.allfields').removeClass('hidden').addClass('hidden')
                $('.allfields input').val('')
                $('.defaultsearch').removeClass('hidden')
            }
        });
        $('[name="district_id"]').on('change', function(){
            setMandals(Object.keys(areas[$(this).val()]), Object.keys(areas), areas);
        });
        $('[name="mandal_id"]').on('change', function(){
            let district = $('[name="district_id"]').val()
            let mandal = $(this).val()
            setVillages(areas[district][mandal], areas[district], Object.keys(areas), areas)
        });
    } );
});
</script>





